import React from "react";
import "./Subject.css";
import {Link} from "react-router-dom";

function Subject(props){

    const createAlert = () =>{
        // eslint-disable-next-line no-restricted-globals
        confirm("Are you sure you want to do Quiz?")
    }

    return(
        <div className={"subject "+ (props.info.open ? "open": "")}
            key={props.index}
             onClick={()=>props.toggleSubject(props.index)}
        >
            <div className={"subject__heading"}>
                {props.info.subject}
            </div>
            <div className={"subject__topics"}>
                {
                    props.info.chapters.map((chapter, i) =>{
                        return(
                            // <Link to={"/quiz"} className={"subject__topics__link"}>
                                <div onClick={createAlert}>
                                    {chapter}
                                </div>
                            // </Link>

                        );
                    })
                }
            </div>
        </div>
    );
}
export default Subject;
